import { Component } from 'react';
class GetDataset extends Component {
    state = {
        serverUrl: 'https://localhost:5220',
        currentDatasetStatus: '',
        isLoaded: false,
        error: '',
    };

    componentDidMount() {
        this.fetchData();
    }

    fetchData() {
        fetch(this.state.serverUrl)
            .then(res => res.json())
            .then(
                (result) => {
                    this.setState({
                        currentDatasetStatus: result.items
                    });
                },

                (error) => {
                    this.setState({
                        isLoaded: false,
                        error
                    });
                }
            )
    }

    render() {
        const { error, isLoaded, currentDatasetStatus} = this.state;
        if (error) {
            return <div className="GetDataset">Error: {error}</div>;
        } else if (!isLoaded) {
            return <div className="GetDataset">Loading...</div>;
        } else {
            return (
                <div className="GetDataset">
                    {currentDatasetStatus}
                    {/*<ul>*/}
                    {/*    {items.map(item => (*/}
                    {/*        <li key={item.id}>*/}
                    {/*            {item.name} {item.price}*/}
                    {/*        </li>*/}
                    {/*    ))}*/}
                    {/*</ul>*/}
                </div>
            );
        }
    }
}

export default GetDataset
